create table "Australia_Hospital"
(
    objectid  integer generated always as identity,
    hsib_id   integer not null,
    hosp_name text,
    category  text,
    street    text,
    pcode     text,
    suburb    text,
    state     text,
    xcoord    text,
    ycoord    text,
    globalid  text
);

alter table "Australia_Hospital"
    owner to "default";

